import React from "react";
import Image from "./Image";
import "./ImageGrid.css";
import content1 from "/pages/project/content1";

function ImageGrid() {
  return (
    <>
      <div className="img-grid-container">
        <div className="img-grid">
          <Image path="/pages/project/content1" src="images/img-1.jpg" />
          <Image path="/" src="images/img-2.jpg" />
          <Image path="/" src="images/img-3.jpg" />
          <Image path="/" src="images/img-4.jpg" />
          <Image path="/" src="images/img-5.jpg" />
          <Image path="/" src="images/img-6.jpg" />
          <Image path="/" src="images/img-7.jpg" />
          <Image path="/" src="images/img-8.jpg" />
          <Image path="/" src="images/img-9.jpg" />
        </div>
      </div>
    </>
  );
}

export default ImageGrid;
